//populates the state select box
function loadStates(state_id,countryCode){
	console.log(countryCode);
		var option_str = document.getElementById(state_id);
		option_str.length=0;	// Fixed by Julian Woods
		option_str.options[0] = new Option('State/Province','');
		option_str.selectedIndex = 0;
		var states = array_collection.states[countryCode];
		var hasStates = typeof states == 'undefined' || states.length == 0 ? false : true;
		if(!hasStates){
			option_str.innerHTML = '<option value=" ">Select State</option>';
			option_str.style.display = 'none';
		}else{
			option_str.innerHTML = '<option value="">Select State</option>';	
			option_str.style.display = 'inline-block';
			for(var code in states){
				var opt = document.createElement('option');
				opt.value = code;
				opt.innerHTML = states[code];
				option_str.add(opt);
			}
		}
}
